import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';

class Logout extends Component {
	constructor(props) {
		super(props);
		let token = localStorage.removeItem('token');
	}

	render() {
		return (
			<div>
				<h1>This is admin page</h1>
				<Link to="/">Logout</Link>
			</div>
		);
	}
}

export default Logout;
